import React from "react";
import { NavLink } from "react-router-dom";
import headerStyle from "../../styles/header/HeaderStyle";

const Header = () => {
  const activeStyleLink = { color: "blue" };

  return (
    <header id="masthead" class="branding" role="banner">
      <div className="container">
        <nav>
          <ul style={headerStyle.ulStyle}>
            <li style={headerStyle.liStyle}>
              <NavLink
                to="/"
                style={headerStyle.aStyle}
                activeStyle={activeStyleLink}
                exact
              >
                Home
              </NavLink>
            </li>
            <li style={headerStyle.liStyle}>
              <NavLink
                style={headerStyle.aStyle}
                to="/covid"
                activeStyle={activeStyleLink}
              >
                Covid
              </NavLink>
            </li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
